import React from 'react';
import {
    BodyContainer,
    Container
} from '../components/StyledComponents/StyledComponents.jsx';
import Navigation from '../components/Navigation/Navigation.jsx';
import PlantOfTheDay from '../components/Plant/PlantOfTheDay.jsx';
import Footer from '../components/Footer/Footer.jsx';
import Data from '../Data.js';
import styled from 'styled-components';

const PlantPageContainer = styled(Container)`
    padding-top: 100px;
    min-height: 100vh;
    background: linear-gradient(
        to bottom,
        ${props => props.theme.colors.plant[50]},
        ${props => props.theme.colors.plant[150]},
        ${props => props.theme.colors.plant[250]},
        ${props => props.theme.colors.plant[350]},
        ${props => props.theme.colors.plant[450]},
        ${props => props.theme.colors.plant[550]},
        ${props => props.theme.colors.plant[650]},
        ${props => props.theme.colors.plant[750]}
    );
`;

const Plant = () => {
    return (
        <>
            <Navigation page="plant" />
            <BodyContainer>
                <PlantPageContainer>
                    <PlantOfTheDay />
                </PlantPageContainer>
            </BodyContainer>
            <Footer />
        </>
    );
}

export default Plant;
